function CardProperties(props) {
    var [title,price,location] = props.properties;
    return(
        <div className="cardProperties">
<h3>{title}</h3>
        <p className="price">{price}</p>{/*  */}
        <p>{location}</p>
        <p>Some text about the nature right here.</p>
        <button
            className="btn btn-primary"
            data-toggle="tooltip"
            title="Send Message"
            onClick={(e) => e.preventDefault()}
          >
            <i className="fas fa-envelope"></i> Melding
          </button>
          <button
            type="button"
            className="btn btn-danger"
            data-toggle="tooltip"
            title="Add to Favorites"
            onClick={(e) => e.preventDefault()}
          >
            <i className="fas fa-heart"></i> Favoritt
          </button>
          <button className="btn btn-secondary"><i class="fas fa-link"></i> Del</button>
        </div>
    )
}

export default CardProperties;
